import React from 'react'
import { Switch } from 'react-router';
import About from './About';
import Contact from './Contact';
import Home from './Home';
import Services from './Services';

const App = ()=>{
  return(
    <>
    <Switch>
        <Home/>
        <Contact/>
        <About/>
        <Services/>
    </Switch>
    </>
  )
}
export default App;
